import { Icon, Typography, ListItem } from '@mui/material';
import PropTypes from 'prop-types';

function Row({ data, index, style }) {
  const { itemsArray, handleOpenDialogRecordDetails, style: classes, array } = data;
  const row = itemsArray[index];
  function msToSeconds(duration) {
    const seconds = Math.ceil((duration / 1000) % 60);
    return `${seconds}`;
  }
  const optionsDateTimeLine = {
    hour: '2-digit',
    minute: '2-digit',
    second: '2-digit',
    hour12: false,
  };
  let rowId = array.findIndex((x) => x._id === (row.record || {})._id);
  if (index === 0) array._skip = 0;
  if (row.type === 'NOTE') {
    rowId = undefined;
    array._skip++;
  } else {
    rowId -= array._skip;
  }
  const numberTable = rowId !== null && rowId !== undefined ? rowId + 1 : '';
  if (row.type === 'RECORD')
    return (
      <ListItem
        key={row.name}
        sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
        onClick={() => {
          handleOpenDialogRecordDetails(row.record);
        }}
        style={style}
      >
        <div align="center">{(row.record || {}).recordSeq}</div>
        <div className={`${classes.tableIcon}`}>
          {row.state === 'check' && <Icon className={`${classes.check}`}>check</Icon>}
          {row.state === 'error' && <Icon className={`${classes.error}`}>error</Icon>}
          {row.state === 'warning' && <Icon className={`${classes.warning}`}>warning</Icon>}
          {row.state === 'save' && <Icon>save</Icon>}
          {row.state === 'note' && <Icon>note</Icon>}
          <Typography>
            {row.timeSent !== null || row.timeSent !== undefined
              ? `${msToSeconds(row.timeSent)}s`
              : ''}
          </Typography>
        </div>

        <div>{new Date(row.timestamp).toLocaleString(navigator.language, optionsDateTimeLine)}</div>
        <div>{row.vel}</div>
        <div>{row.doors}</div>
        <div align="center">{row.input}</div>
        <div align="center">{row.output}</div>
        <div>{row.desvi}</div>
      </ListItem>
    );

  if (row.type === 'NOTE')
    return (
      <ListItem
        key={row.name}
        style={style}
        onClick={() => {
          handleOpenDialogRecordDetails(row);
        }}
        sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
        className={classes.noteCell}
      >
        <div align="center" />
        <div className={`${row.state === 'check' ? classes.tableIcon : 'text-left'}`}>
          <Icon>note</Icon>
        </div>
        <div>{new Date(row.timestamp).toLocaleString(navigator.language, optionsDateTimeLine)}</div>
        <div colSpan={5}>
          <p><b>{row.note}</b></p>
        </div>
      </ListItem>
    );
}
Row.propTypes = {
  index: PropTypes.number.isRequired,
  data: PropTypes.object.isRequired,
  style: PropTypes.object.isRequired,
};

export default Row;
